    // Function to delete an element from an array
    function remove(uint256 index, string[] storage array)
        internal
        returns (bool)
    {
        if (index >= array.length) return false;

        for (uint256 i = index; i < array.length - 1; i++) {
            array[i] = array[i + 1];
        }
        array.pop();
        return true;
    }

